import React, {useState, useEffect} from 'react'

export function MoscowExchange() {
  const [indexDates, setIndexDates] = useState(null);

  useEffect(() => {
    fetch("./indices.csv").then(r => r.text()).then(console.log);
  }, []);

  if (indexDates === null) {
    return null;
  }

  return (
    <div>Moscow Exchange</div>
  )
}
